def fetchPage(url):
		targetUrl = url
		pageHtml = opener.open(targetUrl, timeout=timeOut).read()
		soup = BeautifulSoup(pageHtml, "html.parser")
		housesForSaleSearchForm = soup.find(id="housesForSaleSearchForm")
		scripts = housesForSaleSearchForm.find_all('script', type="text/javascript")


		# cities
		if scripts[1]:
			html_content = scripts[1].string
			if html_content:
				json_text = html_content.replace('// -->', '').replace('<!--', '')
				distinct = {}
				# D array
				d_array_strings = json_text.split(";");
				# D_list = re.findall(r"d\[%d\]=\"(\w+)\"", json_text)


				for item in d_array_strings:
					d = re.match(r"^cnt_h_s\[(.*)\]=\"(.*)\"$", item)
					if d:
						suburb_id = d.group(1);
						count = d.group(2);					
						query = C.execute("INSERT INTO  stats(suburb_id, count) VALUES(%s, %s)", (suburb_id, count))
						DB.commit()

